import React from 'react';
import Navbar from './components/Navbar';


function App() {
  return (
    <div className="App">
       <Navbar />
       <SearchBar />
                <Routes>
                    <Route path="/search" element={<SearchResults />} />
                    {/* Other routes can go here */}
                </Routes>
       <h1>Welcome to Paramount</h1>
    </div>
  );
}

export default App;
